- input: TEXT,"F3XN","","The payment to Gordon & Schwenkmeyer on Schedule B supporting
    Line 21b totaling 7,540.21 for Telemarketing Fees was for the Committees internal
    fundraising expenses and did not reference any federal candidate. The payment
    on Schedule A supporting Line 17 from the Hillary Clinton for President Exploratory
    Committee was made for access to the voter file maintained by the New Hampshire
    Democratic State Committee.  The fee charged for access to the voter file did
    not exceed the usual and normal charge or the ordinary market price at the time
    of the contribution. The fee that the Hillary Clinton for President Exploratory
    Committee was charged for the voter file was pro-rated based on the costs incurred
    by the State Committee in creating and maintaining the file and was also based
    on the amount of information that the Hillary Clinton for President Exploratory
    Committee was allowed to access on the file. This report includes Memo Schedule
    A entries for contributions raised by the ASDC Partnership Program.  The committee
    has not yet received its share of the proceeds as of the end of this reporting
    period.  The committee expects to receive transfers at some point in the three
    months following this reporting period.  The anticipated net amount of the transfer
    to be received by the committee will total $251.41."
